// SPDX-License-Identifier: MIT
pragma solidity >=0.5.0 <0.9.0;

contract SendAndRecieve {
    struct Transaction {
        address sender;
        address receiver;
        uint256 amount;
        uint256 timestamp;
    }

    mapping(address => uint256) public balances;
    Transaction[] public transactionHistory;

    event PaymentSent(address indexed sender, address indexed receiver, uint256 amount, uint256 timestamp);

    function sendPayment(address _receiver, uint256 _amount) public {
        require(_amount > 0, "Amount must be greater than 0");
        require(balances[msg.sender] >= _amount, "Insufficient balance");

        balances[msg.sender] -= _amount;
        balances[_receiver] += _amount;

        Transaction memory newTransaction = Transaction({
            sender: msg.sender,
            receiver: _receiver,
            amount: _amount,
            timestamp: block.timestamp
        });

        transactionHistory.push(newTransaction);

        emit PaymentSent(msg.sender, _receiver, _amount, block.timestamp);
    }

    function getBalance() public view returns (uint256) {
        return balances[msg.sender];
    }

    function getTransactionHistoryLength() public view returns (uint256) {
        return transactionHistory.length;
    }

    function getTransaction(uint256 _index) public view returns (address, address, uint256, uint256) {
        require(_index < transactionHistory.length, "Index out of bounds");
        Transaction storage transaction = transactionHistory[_index];
        return (transaction.sender, transaction.receiver, transaction.amount, transaction.timestamp);
    }
}

